import React, { useState } from "react";
import { Modal, Button } from "antd";

const Mod = () => {
  const [isModalVisible, setIsModalVisible] = useState(false);

  const showModal = () => {
    setIsModalVisible(true);
  };

  const handleOk = () => {
    setIsModalVisible(false);
  };

  const handleCancel = () => {
    setIsModalVisible(false);
  };

  return (
    <Modal
      title="Basic Modal"
      visible
      onOK={handleOk}
      onCancel={handleCancel}
    >
      <h1>Category</h1>
      <h1>Brand</h1>
      <h1>Product</h1>
    </Modal>
  );
};

export default Mod;
